import './App.css';
import AddProducts from './components/AddProducts/AddProducts';
import Home from './components/Home/Home';
import Sidebar from './components/Sidebar/Sidebar';

function App() {
  return (
    <div className="App">
      <Sidebar />
      <div className="container w-full h-full scroll-hidden">
        {/* <Home/> */}
        <AddProducts />
      </div>
    </div>
  );
}

export default App;
